Le temps nécessaire à la création des données d'exportation dépend de la superficie sélectionnée pour vos itinéraires d'inspection ; il est fidèle au barème suivant:

- 30 à 60 secondes pour une superficie de 1 km&#xb2;
- 2 à 3 minutes pour une superficie de 10 km&#xb2;
- 2 à 3 heures pour une superficie de 100 km&#xb2;
